import React from 'react';
import Swiper from 'react-id-swiper';
import 'swiper/css/swiper.css';
import './navBar.scss'


class NavBar extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			swiper: '',
			params : {
				slidesPerView: 3,
				spaceBetween: 0,
				loop: true,
				// pagination: {
				// 	el: '.swiper-pagination',
				// 	clickable: true
				// },
				// navigation: {
				// 	nextEl: '.swiper-button-next',
				// 	prevEl: '.swiper-button-prev'
				// }
			}
		}
	}


	render() {
		return (
			<div className="navContainer" >
				<Swiper {...this.state.params} getSwiper={(swiper) => {this.setState({swiper: swiper}); console.log(swiper)}}>
					<div className="navItems">something</div>
					<div className="navItems">something2</div>
					<div className="navItems">something3</div>
				</Swiper>
			</div>
		)
	}

}

export default NavBar
